function setTransactionRequirements(
    uint256 liquidityFee,
    uint256 marketingFee,
    uint256 burnFee,
    uint256 developmentFee,
    uint256 totalFee,
    uint256 sellFee,
    uint256 transactionFee
) public {
    require(msg.sender == getOwner(), "!OWNER");

    // Update fee variables
    liquidityFee = liquidityFee;
    marketingFee = marketingFee;
    burnFee = burnFee;
    developmentFee = developmentFee;
    totalFee = totalFee;
    sellFee = sellFee;
    transactionFee = transactionFee;

    // Ensure totalFee and sellFee do not exceed 20%
    require(totalFee <= 20, "totalFee and sellFee cannot be more than 20%");
    require(sellFee <= 20, "totalFee and sellFee cannot be more than 20%");
}

